type Args =
{
    status: "idle" | "success" |  "error" | "loading"

}
const ApiStatus = ({status}: Args) => 
{
    switch(status){
        case "error":
            return <div>Error communicating with the data backend</div>;
        case "success":
            return <div>Idle</div>;
        case "loading":
            return <div>Loading........</div>;
        default:
            throw Error("Unknown API state");

    }


}

export default ApiStatus;
